// Calcula la hora en Vancouver
//const vancouverOffset = -7; // Diferencia horaria de Vancouver respecto a UTC en horas (PST)
const now = new Date();
const horaVancouver = new Date(now.getTime() );

// Formatea la hora en el formato deseado
const options = {
  timeZone: 'America/Vancouver',
  hour12: false,
  hour: 'numeric',
  minute: 'numeric',
  second: 'numeric'
};

const horaFormateada = horaVancouver.toLocaleTimeString('en-US', options);

// Establece el valor de salida
return { horaActual: horaFormateada };
